import Card from "./Card";

function Tours(props){
    return (
        <div>
            <div>
                <h2>Plan with Love</h2>
            </div>
            <div>
                {
                    props.tours.map((tour)=>{
                        return <Card {...tour}/>
                    })
                }
            </div>
        </div>
    );
}

export default Tours;
